import "./App.css";
import Home from "./Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Route exact path="/uncompleted" component={Home} />
      </Router>
    </div>
  );
}

export default App;
